import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import "./css/navigation.css";


const navLinks=[
    {
        title: "Home",
        path: '/'
    },
    {
        title: 'Blog',
        path: '/blog'
    },
    {
        title: 'Contact Us',
        path: '/contact-us'
    }
];

function Navigation(){
    return(
    <div class="container">
      
<nav class="navbar navbar-expand-md navbar-light d-flex py-3">
    <a class="navbar-brand" href="#">MiniBlog</a>
    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
      <div class="navbar-nav">
      {
        navLinks.map((link,index)=>{
           return <a key={index} class="nav-item nav-link" href={link.path}>{link.title}</a>
        })
      }
      </div>
      
      <a class="nav-item nav-link ">
        <button type="button" class="btn btn-outline-primary me-2 mr-2">Login</button>
        <button type="button" class="btn btn-primary">Sign-up</button> 
         </a>
      {/* <a class="nav-item nav-link py-2"> </a> */}
    </div>
    
</nav>

    </div>
    
    )
}

export default Navigation;
